import * as S from '../styles/MainStyle';
import { SearchReData } from 'utils/searchUtils';

function SearchRec() {
  const empty = '최근 검색어가 없습니다.';
  return (
    <S.SearchRecLayout>
      <S.RecentWords> 최근 검색어 </S.RecentWords>
      <SearchReData data={(empty, 'filled', [])} />
    </S.SearchRecLayout>
  );
}

export default SearchRec;
